import React from 'react';
import Tag from './Tag';

class TagList extends React.Component {
    state = {
        tagname: "BIMBO",
    }

    render(){
        return(
            <div class="tags">
                <Tag
                    tagname={this.props.tagname} 
                    key={this.id}
                    deleteTag={this.props.deleteTodo}
                    />
                <Tag tagname={this.state.tagname} />
                <Tag tagname={this.state.tagname} />
                <Tag tagname={this.state.tagname} />
                <Tag tagname={this.state.tagname} />
                <Tag tagname={this.state.tagname} />
                <Tag tagname={this.state.tagname} />
                <Tag tagname={this.state.tagname} />
            </div>
        )
    }
}

export default TagList;
